                <Thriller initialMovies={initialMovies} />

                <Thriller initialMovies={initialMovies} />

                <Thriller initialMovies={initialMovies} />

                <Thriller initialMovies={initialMovies} />

        </>
    )
}

MovieRecommendation.propTypes = {
    initialMovies: movieArray
}
